import React from 'react';

const ContactPageFilter = () => {

    return(
        <div className="leftContainer">

            <div className="textContainer">
                <h1 className="FormText"> 1.Kies de professional </h1>

                <p className="FormText"> Kies in de linkerkolom de professional die u een bericht wilt sturen.
                    <br/>
                    Vul het formulier in ne kilk op verzenden
                </p>
            </div>

            <form className="inputContainer">
                <input placeholder="Naam" className="placeText"/>
                <input placeholder="E-mailadres" className="placeText"/>
                <input placeholder="Telefoonnummer" className="placeText"/>
                <input placeholder="Type hier je bericht" className="placeTextBig"/>
            </form>

        </div>
    );
};

export default ContactPageFilter;
